{'edges': [{'node': {'text': 'Part 2 of 2: Under the Wild Free-Roaming Horses and Burros Act of 1971 (WFRHBA).

This law defines horses as â€œliving symbols of the historic and pioneer spirit of the Westâ€ and mandates their protection on public lands managed by the Bureau of Land Management (BLM) and the U.S. Forest Service. 

Horses originated in North America millions of years ago (like Equus ferus), but went extinct on this continent around 10,000 years ago, likely due to climate change and human activity and today Wild horses in North America are not truly â€œwildâ€ in the ecological senseâ€” descended from domestic horses reintroduced by Europeans in the 1500s. Interesting perspective all around.'}}]}

