{'edges': [{'node': {'text': 'Aversion towards the driving aids can have many reasons from a natural aversion towards physical pressure, training holes, prior reinforcement history to underlying physically or health issues (eg. Pain caused by ill fitting tack, ulcers, soreness, kissing spines etc)

When dealing with a behavioral issue like this itâ€™s important to break it down into digestible learning steps since the basic idea of â€œwhen my leg is on you please trot offâ€ isnâ€™t established as such,.. we have to first explain the cue and its meaning and then we can built the duration from there. 

While a lot of people try to instantly go for â€œYou pick up a trot NOW and once youâ€™re trotting I wonâ€™t let you get back to a walk Until I say so! And if you slow down youâ€™ll trot 10 more roundsâ€ - pushing past the problem to directly get to the goal of wanting to trot for rounds at a time, the horse needs to clearly understand the different meanings of the leg itself or heâ€™ll easily start to mistake the driving aid more as a punisher and something he needs to be afraid off and ran away from rather than it being a trustworthy and reliable tool of communication.

By the time the horse is cow kicking, crow hopping or swinging his butt around heâ€™s already reaching his own current limit of tolerance and understanding of what weâ€™re asking him to do. Hence why punishment and getting â€œpushier and more heavy handedâ€ wonâ€™t help him understand better what heâ€™s already not understanding in the first place. 

Itâ€™s like creating a yelling match of ðŸ´â€œBut I donâ€™t know what you what?!â€ - ðŸ¤¦ðŸ¼‍â™€ï¸â€Just do the damn thing!â€ ðŸ´â€But I donâ€™t know what the damn thing is ?!â€ â€¦the more we stay in this fight the more it will escalate. The more frustration we built, the less progress is being madeâ€¦

Instead. We break things down into the smallest reinforceable step thatâ€™s available to us like eg. walking a little faster.. from there we can work on please walk a little faster .. please pick up a split second the idea of a trot stepâ€¦ please pick up one trot step..please pick up two trot steps and so on. ðŸ´ðŸ’« 

